On November 29th, we had the delightful honor of hosting an exquisite Fall 2024 Bridal Presentation for @oscardelarenta at the prestigious @pelicanhillresort. The event showcased fashion ensembles curated around the three distinct nights a bride might encounter during a “Grand Wedding Weekend.” Featuring a stunning array from cocktail dresses to ready-to-wear bridal gowns for the big day, the Fall 2024 Oscar De La Renta collection graced the awe-inspiring Pelican Hill landscape, creating a captivating visual spectacle.

